import React from 'react';
import Dashboard from './Dashboard';

function App() {
  return (
    <div className="App">
      <header>
        <h1>Admin Dashboard</h1>
      </header>
      <main>
        <Dashboard />
      </main>
      <footer>
        <p>&copy; 2024 Admin Dashboard. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
